  return (
    <Box padding={3}>
      <Typography variant="h4" gutterBottom>
        Hotel Admin Dashboard
      </Typography>
      <Typography mb={2}>
        Manage inventory and orders here.
      </Typography>
      <Typography variant="body1">Hello! {username}</Typography>
      {/* Add your hotel admin content here */}
    </Box>
  );
}

export default HotelAdminUser;
